(1, 'customer_signup_admin', 'Admin | Customer Signup', 'Thank you for joining us - {site}', '<div style=\"margin:0;padding:0;width:100%;font-weight:500;font-size:16px;line-height:26px;background:none #fafafa;font-family:Helvetica Neue,Helvetica,Arial,sans-serif\">\r\n<table align=\"center\" border=\"0\" cellpadding=\"20\" cellspacing=\"0\" style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;margin:0;padding:0;line-height:100%;background:none #fafafa\">\r\n	<tbody>\r\n		<tr style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif\">\r\n			<td style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%\">\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:650px\">\r\n				<tbody>\r\n					<tr style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif\">\r\n						<td style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%\">\r\n						<table style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%\">\r\n							<tbody>\r\n								<tr style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif\">\r\n									<td align=\"left\" height=\"45\" style=\"width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px\"><a style=\"color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none\" target=\"_blank\"> <img alt=\"{site}\" src=\"{site_link}images/new-logo.png\" style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;outline:none;text-decoration:none;max-width:100%;border:none\" width=\"100\" /> </a></td>\r\n									<td align=\"right\" style=\"width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:colla