r\n							<tbody>\r\n								<tr style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif\">\r\n									<td align=\"center\" height=\"150\" style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%\">\r\n									<p style=\"color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px\"><a style=\"color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px\" target=\"_blank\"> <img alt=\"{site}\" src=\"{site_link}images/small-logo.png\" style=\"color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;outline:none;text-decoration:none;max-width:100%;border:none\" width=\"32\" /> </a></p>\r\n\r\n									<p style=\"color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px\">This email was sent to <a href=\"mailto:{email}\" style=\"color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px\" target=\"_blank\"> {email} </a>.<br />\r\n									If you want to unsubscribe the emails from {site}, please drop a email at <a href=\"mailto:{help_email}\" style=\"color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px\" target=\"_blank\"> {help_email} </a>.<br />\r\n									If you have any questions or concerns, please email us at <a href=\"mailto:{info_email}\" style=\"color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px\" target=\"_blank\"> {info_email} </a>.</p>\r\n\r\n									<p style=\"color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px\"><span style=\"color:#b1aca